import React from 'react'
import Profile from './Profile'
import Skills from './Skills'
import { skillsData } from '../../utility'

import {Container, Typography, Grid} from '@material-ui/core'
import {makeStyles} from '@material-ui/core/styles'

const useStyles = makeStyles(theme => ({
  root: {
    background: theme.palette.type === 'light' ? theme.palette.userBackground.light : theme.palette.userBackground.dark,
    marginTop: theme.spacing(5),
    paddingTop: theme.spacing(10),
    marginBottom: theme.spacing(50)
  },
  component: {
    marginTop: theme.spacing(5)
  }
}))

function About() {
  const classes = useStyles()
  // maxWidth={false} justify="center" align="center"  className={classes.root}
  return (
    // <Container item  id="abo id=""ut">
    <div id="">
      <Typography variant="h3" align= "center" style={{
      fontWeight: 800,
      textTransform: 'uppercase',
      marginBottom: 48
    }} >About</Typography>
      <Grid container justify="space-around" className={classes.component}>
        <Grid item xs={12} sm={4} >
          <Profile />
        </Grid>
        <Grid item xs={12} sm={6}>
          {skillsData.map(skill => {
            return <Skills key={skill.id} {...skill} />
          })}
        </Grid>
      </Grid>
    {/* </Container> */}
    </div>
  )
}

export default About
